import React from 'react';

const ComplexList = props => {
    return(
    <div>
    <ul>
        {props.items.map(item => (
            <li key={item._id}>
                <div>{item._id}</div>
                <div>{item.residentFirstName}</div>
            </li>
        ))}
    </ul>]
    </div>
    )
};

export default ComplexList;

